      out.write("            <p class=\"card-text\">파리는 프랑스의 수도이자 유럽의 대표도시 중 하나입니다. 파리와 같은 대도시는 짧은 일정으로는 둘러보기 힘들 정도로 관광명소가 많은데요. 따라서 서유럽 3개국 정도를 10박에 걸쳐 방문할 예정이라면, 파리에서 3박4일 정도는 머물러야 좋습니다. 프랑스는 미식가들의 나라인 만큼, 반드시 먹어봐야 할 것들도 소개해드립니다 :-)</p>\r\n");
